            this.turn = 0;
            this.previousKilledUnits = 0;
            this.previousPlayerUnits = 0;
            this.previousOutsideBaseZone = 0;
            this.previousSelectedDirection = -1;
            this.checkForSpawnedEnemy = true;
            this.trackedEnemies = [];

            // Restart game
            this.game.init();

            setTimeout(this.autoPlay.bind(this), 1000);
